import React from 'react';
import '../main.css';
import Header from '../../components/Header'

export default function Inicio() {
    
    
    return(
        <React.Fragment>
            <Header />
            <div className="container">
                <div>
                    <button onClick="">LOGIN</button>
                    <button onClick="">CADASTRO</button>
                </div>
            </div>
        </React.Fragment>
    );
}
